// SPDX-License-Identifier: MIT

pragma solidity ^0.8.11;

import "@openzeppelin/contracts/access/Ownable.sol";

contract HachiStorage is Ownable {
    string private hachiGenericMetaDataURI;
    string private hachiIPFSMetaDataURI;

    bool private metaDataReveal;
    bool public publicMint;

    uint public mintPrice;
    uint public mintLimit;

    mapping(uint256 => uint256) private control;
    mapping(address => uint256) private numberMinted;

    struct HachiTicket {
        uint256[] tokenId;
        uint256[] amounts;
        address to;
        bytes signature;
        bytes32[] merkleProof;
    }

    constructor(string memory _hachiGenericMetaDataURI, string memory _hachiIPFSMetaDataURI, uint _mintPrice){
        hachiGenericMetaDataURI = _hachiGenericMetaDataURI;
        hachiIPFSMetaDataURI = _hachiIPFSMetaDataURI;

    }

    function updateMintLimit(uint _limit) public onlyOwner {
        mintLimit = _limit;
    }

    function updateMintPrice(uint _price) public onlyOwner {
        mintPrice = _price;
    }

}

